import React, { useContext } from "react";
import { Context } from "../index";
import { getBasket } from "../api/BasketApi";

export const Basket = () => {
  const { userStore } = useContext(Context);

  if (!userStore.isAuth) {
    return (
      <div>
        <div>not Auth user</div>
      </div>
    );
  }
  if (userStore.isAuth) {
    const basket = getBasket(userStore.user.id);
    console.log(basket)
    return (
      <div>
        {!basket.basketItem ? <div>basket is empty</div> : <div>basket</div>}
      </div>
    );
  }
};
